import React from 'react';
import ReactDOM, { createRoot } from "react-dom/client"
import "./style.css"

const root = ReactDOM.createRoot(document.getElementById("root"))


//Nav Component
function Navbar(){
    return(
        <nav>
            <h1>Perfumy</h1>
            <ul>
            <li>Home | </li>
            <li>Products | </li>
            <li>About | </li>
            <li>Contact | </li>
            </ul>
        </nav>
    )
}

//search 
function Search(){
    return(
        <div className='searchbar'>
            <input type='text' placeholder='Search perfumes'/>
        </div>
    )
}


root.render(
    <div>
    <Navbar></Navbar>
    <Search></Search>
    </div>
)
